import React, { Component } from 'react'
import './home.css'
import  Logo from '../imgs/Green_Logo.png';
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'

export default class Home extends Component {
    constructor(props){
        super(props)
        this.state = {
            display: true, 
            autoplay: false,
        }
    }
   

render(){
    return(
        //header for each page -- logo (home button), work, play tabs
        <div className='header'>
            <Row>
                <Col md = {2}>
                    <img src={Logo} alt='header' style={{width:'40%', height:'100%'}} href='/'/>
                </Col>
                <Col md={4}></Col>
                <Col md = {1} style={{marginTop:'50px'}}>  
                    <h4 href='/'>WORK</h4>
                </Col>
                <Col md = {1} style={{marginTop:'50px'}}>
                    <h4 href='/'>PLAY</h4>
                </Col>
            </Row>   
            <div className='introSummary'>
                <p style={{position:'relative', display:'flex', marginLeft:'25%'}}> hello</p>
            </div>
        </div>

        //summary intro section
        
    )
}

}
